import { CLASSES_STATISTICAL } from './../constants/types';

const initialState = [];
export default function(state = initialState, action) {
    switch(action.type)
    {
        case CLASSES_STATISTICAL:
            return action.payload.classPresences;
        default:
            return state;
    }
};
